import React, { Component } from 'react';

export default class Contact extends Component {
  render() {
    return (
      <>
        <h1>contact</h1>
        <div className="contact_static">
           <p> styles with static css</p>
        </div>
        <div>
          <img src = "/static/images/knicks.jpeg" />
        </div>
      </>
    );
  }
}

